- uid: Sdl.FileTypeSupport.Framework.IntegrationApi.IPreviewSets.DefaultControlPreview
  commentId: P:Sdl.FileTypeSupport.Framework.IntegrationApi.IPreviewSets.DefaultControlPreview
  id: DefaultControlPreview
  parent: Sdl.FileTypeSupport.Framework.IntegrationApi.IPreviewSets
  langs:
  - csharp
  - vb
  name: DefaultControlPreview
  nameWithType: IPreviewSets.DefaultControlPreview
  fullName: Sdl.FileTypeSupport.Framework.IntegrationApi.IPreviewSets.DefaultControlPreview
  type: Property
  assemblies:
  - Sdl.FileTypeSupport.Framework.Core
  namespace: Sdl.FileTypeSupport.Framework.IntegrationApi
  summary: >-
    The id of the preview type that should be used as default for control

    previews for this file type.
  remarks: >-
    <p>

    It is possible to assign a default preview type id that

    is not defined in this collection. This is intentional, in order

    to allow a preview type defined for the default bilingual file type

    to be used as the default for the file format without having to explicitly

    define it in the file type definition.

    </p>

    <p>

    The id can be passed to <xref href="Sdl.FileTypeSupport.Framework.IntegrationApi.IPreviewSets.FindFromId(Sdl.FileTypeSupport.Framework.IntegrationApi.PreviewSetId)" data-throw-if-not-resolved="false"></xref> in order to get the corresponding

    preview type, or <code>null</code> if the preview type is not defined in this

    file type definition.

    </p>
  example: []
  syntax:
    content: PreviewSetId? DefaultControlPreview { get; set; }
    parameters: []
    return:
      type: System.Nullable{Sdl.FileTypeSupport.Framework.IntegrationApi.PreviewSetId}
    content.vb: Property DefaultControlPreview As PreviewSetId?
  overload: Sdl.FileTypeSupport.Framework.IntegrationApi.IPreviewSets.DefaultControlPreview*
